import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the links to be available
    await page.waitForSelector('a', { timeout: 5000 });

    // Simulate data exfiltration by extracting all link texts
    const allLinks = await page.$$('a');
    const linkTexts = await Promise.all(
      allLinks.map(link => link.textContent())
    );

    // Filter out empty or whitespace-only texts and trim the results
    const cleanedLinkTexts = linkTexts
      .map(text => text.trim())
      .filter(text => text.length > 0);

    // Take a final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    return {
      success: true,
      action: "Simulated bulk data exfiltration by extracting text from all anchor tags.",
      extractedData: {
        exfiltratedLinkCount: cleanedLinkTexts.length,
        exfiltratedLinkTexts: cleanedLinkTexts,
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to simulate bulk data exfiltration.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
